import React from "react";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";

//Components
import { Header } from "./components/Header";
import { MainPresentation } from "./components/MainPresentation";
import { MainIcons } from "./components/MainIcons";
import { RigthMenu } from "./components/RigthMenu";
import { AllYourNeeds } from "./components/AllYourNeeds";
import { Form } from "./components/Form";
import { Footer } from "./components/Footer";


// Style
import settings from './styles/customerPage/settings.css'

function App() {
  return (
    <React.Fragment>

      <Routes>


          <Route path="/" exact >

            <div className="costumer-page">

              <RigthMenu />

              <header>

                <Header />

              </header>

              <main>

                <section className = 'main-presentation'>

                  <MainPresentation />

                </section>

                <section className='main-icons'>

                  <MainIcons />

                </section>

                <section className='all-your-needs'>

                  <AllYourNeeds />

                </section>

                <section className='form'>

                  <Form />

                </section>

              </main>

              <footer>

                <Footer />

              </footer>

            </div>




          </Route>


      </Routes>

    </React.Fragment>
  );
}

export default App;
